import React,{Component} from 'react'
import { View, Text,
    
   
    StyleSheet,
    
Image,
ImageBackground,} from 'react-native';


const Dashboard=(props) =>{

   


    return (
        
         <Image  source={props.picture} style={styles.image}/>
         
            
           
        


    
    );
};
export default Dashboard;
const styles = StyleSheet.create({
    image: {
      flex: 1,
      width:40,
    },
}
);
